  source:
    '// SPDX-License-Identifier: MIT\n// TODO: Change SPDX license types\npragma solidity ^0.8.7;\n\nimport "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";\nimport "@openzeppelin/contracts/utils/Counters.sol";\n\ncontract MemoryContract is ERC721URIStorage {\n    using Counters for Counters.Counter;\n    // Counter to keep track of most\n    Counters.Counter private _tokenIds;\n    // keep track of ipfs hashes that already have an NFT\n    mapping(string => uint8) hashes;\n\n    // ERC721 constructor allows you to pass in name and symbol of\n    constructor() ERC721("MemBlock", "MEM") {}\n\n    function awardItem(\n        address recipient,\n        string memory hash,\n        string memory metadata\n    ) public returns (uint256) {\n        require(hashes[hash] != 1);\n        hashes[hash] = 1;\n        _tokenIds.increment();\n        uint256 newItemId = _tokenIds.current();\n        // _mint is an open zepplin function. It adds token to map of tokens / token balances\n        // and checks that recipient is not a zero address and token doesn\'t already exist\n        _mint(recipient, newItemId);\n        // metadata will be json payload that includes\n        _setTokenURI(newItemId, metadata);\n        return newItemId;\n    }\n}\n',
